// Calculate price changes and determine if alerts are needed
const results = [];
const THRESHOLD = 3; // 3% change threshold

for (const item of $input.all()) {
  const data = item.json;

  // Calculate percentage change over 1 hour
  const currentPrice = parseFloat(data.current_price);
  const priceChange1h = parseFloat(data.price_change_percentage_1h_in_currency || 0);

  // Determine if this coin needs an alert
  const needsAlert = Math.abs(priceChange1h) > THRESHOLD;

  results.push({
    json: {
      symbol: data.symbol.toUpperCase(),
      name: data.name,
      current_price: currentPrice,
      price_change_1h: priceChange1h,
      price_change_1h_abs: Math.abs(priceChange1h),
      needs_alert: needsAlert,
      change_direction: priceChange1h > 0 ? 'up' : 'down',
      threshold_exceeded: needsAlert,
      processed_at: new Date().toISOString()
    }
  });
}

// Filter to only return items that need alerts
const alertItems = results.filter(item => item.json.needs_alert);

// If no alerts needed, return empty array to stop workflow
if (alertItems.length === 0) {
  return [];
}

return alertItems;

